import React from "react";
import "./AboutUs.css";

const AboutUs = () => {
  return (
    <div className="about-container">
      <h2 className="about-title">About Pata Nyumba</h2>
      <p className="about-text">Pata Nyumba is a modern real estate platform that connects tenants with landlords seamlessly.</p>
    </div>
  );
};

export default AboutUs;
